import React from 'react';

const Mine = () => {
  return (
    <div style={{
      width: '100%',
      minHeight: '100vh',
      margin: 0,
      padding: '2.5rem 3rem',
      boxSizing: 'border-box',
      backgroundColor: '#F5F7FA',
      fontFamily: 'Inter, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, sans-serif'
    }}>
      {/* Main Layout - Left & Right */}
      <div style={{
        display: 'flex',
        gap: '2.5rem',
        width: '100%'
      }}>
        {/* Left Section - Personal Info */}
        <div style={{
          width: '30%',
          display: 'flex',
          flexDirection: 'column',
          gap: '1.5rem'
        }}>
          <div style={{
            backgroundColor: '#FFFFFF',
            borderRadius: '12px',
            boxShadow: '0 4px 12px rgba(0, 0, 0, 0.04)',
            padding: '2rem',
            flex: 1
          }}>
            <h2 style={{
              fontSize: '1.3rem',
              color: '#1D2129',
              margin: '0 0 1.8rem 0',
              fontWeight: 600
            }}>Personal Information</h2>
            
            <div style={{
              display: 'flex',
              flexDirection: 'column',
              gap: '1.2rem'
            }}>
              <div style={{
                display: 'flex',
                flexDirection: 'column'
              }}>
                <span style={{
                  fontSize: '0.95rem',
                  color: '#64748B',
                  marginBottom: '0.3rem'
                }}>Name</span>
                <span style={{
                  fontSize: '1.1rem',
                  color: '#1D2129',
                  fontWeight: 500
                }}>Information Technology</span>
              </div>

              <div style={{
                display: 'flex',
                flexDirection: 'column'
              }}>
                <span style={{
                  fontSize: '0.95rem',
                  color: '#64748B',
                  marginBottom: '0.3rem'
                }}>ID</span>
                <span style={{
                  fontSize: '1.1rem',
                  color: '#1D2129',
                  fontWeight: 500
                }}>123456</span>
              </div>

              <div style={{
                display: 'flex',
                flexDirection: 'column'
              }}>
                <span style={{
                  fontSize: '0.95rem',
                  color: '#64748B',
                  marginBottom: '0.3rem'
                }}>Birthday</span>
                <span style={{
                  fontSize: '1.1rem',
                  color: '#1D2129',
                  fontWeight: 500
                }}>2025-01-01</span>
              </div>
            </div>

            <button style={{
              width: '100%',
              backgroundColor: '#165DFF',
              color: '#FFFFFF',
              border: 'none',
              borderRadius: '6px',
              padding: '0.8rem 0',
              fontSize: '1rem',
              fontWeight: 500,
              cursor: 'pointer',
              marginTop: '2rem',
              transition: 'backgroundColor 0.2s ease'
            }}>Edit Profile</button>
          </div>
        </div>

        {/* Right Section - Reservation & Favorites */}
        <div style={{
          width: '70%',
          display: 'flex',
          flexDirection: 'column',
          gap: '1.8rem'
        }}>
          {/* Stat Cards - Reserved Seats & Check-in Rate */}
          <div style={{
            display: 'flex',
            gap: '1.8rem',
            width: '100%'
          }}>
            <div style={{
              flex: 1,
              backgroundColor: '#FFFFFF',
              borderRadius: '12px',
              boxShadow: '0 4px 12px rgba(0, 0, 0, 0.04)',
              padding: '1.8rem',
              display: 'flex',
              flexDirection: 'column',
              justifyContent: 'center'
            }}>
              <span style={{
                fontSize: '0.95rem',
                color: '#64748B',
                marginBottom: '0.5rem'
              }}>Number of Reserved Seats</span>
              <span style={{
                fontSize: '2.2rem',
                color: '#1D2129',
                fontWeight: 600
              }}>17</span>
            </div>

            <div style={{
              flex: 1,
              backgroundColor: '#FFFFFF',
              borderRadius: '12px',
              boxShadow: '0 4px 12px rgba(0, 0, 0, 0.04)',
              padding: '1.8rem',
              display: 'flex',
              flexDirection: 'column',
              justifyContent: 'center'
            }}>
              <span style={{
                fontSize: '0.95rem',
                color: '#64748B',
                marginBottom: '0.5rem'
              }}>Check-in Rate</span>
              <span style={{
                fontSize: '2.2rem',
                color: '#1D2129',
                fontWeight: 600
              }}>92%</span>
            </div>
          </div>

          {/* Recent Appointment */}
          <div style={{
            backgroundColor: '#FFFFFF',
            borderRadius: '12px',
            boxShadow: '0 4px 12px rgba(0, 0, 0, 0.04)',
            padding: '1.8rem',
            display: 'flex',
            justifyContent: 'space-between',
            alignItems: 'center'
          }}>
            <div>
              <h3 style={{
                fontSize: '1.1rem',
                color: '#1D2129',
                margin: '0 0 0.6rem 0',
                fontWeight: 600
              }}>Most Recent Appointment</h3>
              <p style={{
                fontSize: '1rem',
                color: '#475467',
                margin: 0
              }}>2025-07-17 12:00 | Classroom C4-13 | Seat 37</p>
            </div>

            <button style={{
              backgroundColor: 'transparent',
              border: '1px solid #165DFF',
              color: '#165DFF',
              borderRadius: '6px',
              padding: '0.6rem 1.2rem',
              fontSize: '0.95rem',
              fontWeight: 500,
              cursor: 'pointer',
              transition: 'backgroundColor 0.2s ease'
            }}>Modify</button>
          </div>

          {/* Favorite Classrooms */}
          <div style={{
            backgroundColor: '#FFFFFF',
            borderRadius: '12px',
            boxShadow: '0 4px 12px rgba(0, 0, 0, 0.04)',
            padding: '1.8rem'
          }}>
            <div style={{
              display: 'flex',
              justifyContent: 'space-between',
              alignItems: 'center',
              marginBottom: '1.2rem'
            }}>
              <h3 style={{
                fontSize: '1.1rem',
                color: '#1D2129',
                margin: 0,
                fontWeight: 600
              }}>My Favorite Classrooms</h3>
              <a href="/favorite-classrooms" style={{
                fontSize: '0.95rem',
                color: '#165DFF',
                textDecoration: 'none',
                fontWeight: 500
              }}>view all &gt;</a>
            </div>

            <div style={{
              display: 'flex',
              gap: '1.5rem',
              flexWrap: 'wrap'
            }}>
              {['C3-04', 'C4-14', 'A2-11'].map((classroom, index) => (
                <span key={index} style={{
                  backgroundColor: '#F0F5FF',
                  color: '#165DFF',
                  borderRadius: '4px',
                  padding: '0.5rem 1rem',
                  fontSize: '0.95rem',
                  fontWeight: 500
                }}>{classroom}</span>
              ))}
            </div>
          </div>

          {/* Favorite Seats */}
          <div style={{
            backgroundColor: '#FFFFFF',
            borderRadius: '12px',
            boxShadow: '0 4px 12px rgba(0, 0, 0, 0.04)',
            padding: '1.8rem'
          }}>
            <div style={{
              display: 'flex',
              justifyContent: 'space-between',
              alignItems: 'center',
              marginBottom: '1.2rem'
            }}>
              <h3 style={{
                fontSize: '1.1rem',
                color: '#1D2129',
                margin: 0,
                fontWeight: 600
              }}>My Favorite Seats</h3>
              <a href="/favorite-seats" style={{
                fontSize: '0.95rem',
                color: '#165DFF',
                textDecoration: 'none',
                fontWeight: 500
              }}>view all &gt;</a>
            </div>

            <div style={{
              display: 'flex',
              gap: '1.5rem',
              flexWrap: 'wrap'
            }}>
              <span style={{
                backgroundColor: '#F0F5FF',
                color: '#165DFF',
                borderRadius: '4px',
                padding: '0.5rem 1rem',
                fontSize: '0.95rem',
                fontWeight: 500
              }}>Table2-06</span>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Mine;
